import logo from "./Logo-w.png"
import "./pinknav.css"

function PinknavLog() {
    return(
        <div className= 'pink-nav-left inlog'>

            <img className='foto-container' src= {logo}/>
            <h2>Algemeen</h2>

        </div>
    )
}


export default  PinknavLog;
